HuaWise Fit provides you with accurate motion recording, heare rate details, sleeping details and multi-sport exercise analysis. Integrate with Health App to achieve data synchronization.Encourage you to love sport and live a healthier life. 

The main features of HuaWise Fit include:
1.Health data display: HuaWise Fit records data relevant to your physical condition such as steps taken, sleep hours, heart rate, calories burned, ECG, and SpO2, and so on;
2.Exercise data analysis: HuaWise Fit is also able to record your multi-sport exercise, and will display various data, including a detailed route and various exercise data analysis afterwards;
3.Smart personal assistant: HuaWise Fit can work as your life assistant, such as message and call notification, watch face replacement, alarm, sedentary reminder, drinking water reminder and so on. You can enjoy a healthy life and discover more fun.
4. Integrate with Health App. After connect the HuaWise Fit App with smart watch, all kind of exercise and healthy data will be synchronized to Helath App. It will be more convenient for these people who have a habit of using Health App to view daily sport data.

TOZO FIT sports and health App with new features.

－       It integrates such functions as health data recording, movement track recording and wearable device control, acting as your exclusive health steward.


－It records all data from your wearable device, allowing you to focus more on your exercise!


After connecting your wearable device to the TOZO FITApp, you have access to:



[Manage Health]: 
Record and manage the monitoring data on HR, stress, sleep and SpO2, and set the menstrual cycle reminder;
Set alarms, call reminders, message notifications, inactivity reminders, drinking reminders, serving as an assistant in your life;
Record your sleep data, including sleep duration, deep sleep, light sleep and rapid eye movements (REM), in order to monitor and improve your sleep quality;
Record your weight trends and set your weight goal, encouraging you to achieve the daily exercise goal;



[Record Exercise& Activities]: 
Record your exercise data of more than 20 sports (running, biking, swimming, rowing machine, etc.), including your movement track, HR, pace, etc.;

Record your daily walking steps, calories, medium and high-intensity exercise and other activity data, and view the complete records on a daily/weekly/monthly basis;



[Change Dial]: A rich selection of watch face themes are available in the brand-new cloud dial market, giving your device a new look every day;





[Share Achievements]: If you use TOZO FITApp to monitor your excercises continuously, virtual medals will be awarded when you reaches milestones. You can share your weekly exercise information for interaction with your friends.



[Data Share]: Connect to synchronize data to Apple Health (HealthKit), to achieve data movement, data and consumed calories sleep simultaneous recording to Apple Health (HealthKit)



TOZO FIT App supports multiple languages, and it will support more wearable devices in the future, bringing you more wonderful experiences!



You are welcome to send you feedback to: support@tozostore.com.

The main function:

- Measure and record motion data in real time, and provide weekly or monthly motion trend graphs to make the movement situation clear at a glance;

- Detect sleep data, record the length of deep sleep, shallow sleep time, help users understand their sleep in real time;

- set the bracelet after connecting the bracelet, you can carry out a number of personalized settings such as call alert, smart alarm, sedentary reminder, step number, etc., to provide more convenience for the user's life;

- record your riding, running, etc., visualize the results of the data, let you know your own movements;
